import {useSpring, animated} from 'react-spring'
import {Trail, config} from 'react-spring/renderprops.cjs'

const items = [
    {
        key:0,
        text:"hey bob"
    },
    {
        key:1,
        text:"sup billy"
    },
    {
        key:2,
        text:"you know what, fuck you both"
    },
    {
        key:3,
        text:"what did you say???"
    },
    {
        key:4,
        text:"you know what i said bob, and your wife knwos too"
    },
    {}
]

function Gallery() {
    return (
        <Trail 
            items={items}
            keys={item => item.key}
            from={{transform: 'translate3d(0,-140px,0)'}} 
            to={{transform: 'translate3d(0,0px,0)'}}
            config={config.molasses}>
            {item => props => <span>{item.text}</span>}
        </Trail>
    )
}

export default Gallery;
